// LandingPage.js
import React from 'react';
import './LandingPage.css';
import cheeseburgerImage from './images/cheese-burger.png'

const LandingPage = ({ goToMenu }) => {
  return (
    <div className="landing">
      <div className="top-section">
        <img src="header-image.jpg" alt="Header Background" className="header-background"/>
        <div className="content">
          <div className="logo-circle">
            <img src="logo.png" alt="Logo" className="logo"/>
          </div>
          <h1>THE 101</h1>
          <p>Locally brewed coffee and fresh pastries every day</p>
          <button className="order-button">Makan di Tempat</button>
        </div>
      </div>
      <div className="bottom-section">
        <button className="tutorial-button">Lihat Tutorial</button>
      </div>
    </div>
  );

};

export default LandingPage;
